import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100px;
  height: 100vh;
`;

const Sidebar = () => {
  return (
    <Container>
      Lorem ipsum, dolor sit amet consectetur adipisicing elit. Assumenda
      recusandae, beatae dolorum, enim quod voluptates magnam aspernatur at
      reiciendis accusantium magni nesciunt ipsa aliquid. Ipsum maxime quidem
      dolore eius vero!
    </Container>
  );
};

export default Sidebar;
